INSERT INTO `Clinics` (`id`, `name`, `address`, `descriptionHTML`, `desciptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(2, 'Bệnh viện Hồng Ngọc', 'Số 8 đường Châu Văn Liêm, phường Phú Đô, quận Nam Từ Liêm, Hà Nội', '<h3><strong>GIỚI THIỆU</strong></h3>\n<p>Hệ thống Bệnh viện Đa khoa Hồng Ngọc được xây dựng với mô hình bệnh viện – khách sạn tiên phong ở Hà Nội cũng như toàn khu vực miền Bắc. Đến nay, trải qua gần 20 năm xây dựng và phát triển, Hồng Ngọc đã trở thành thương hiệu quen thuộc và là địa chỉ y tế đáng tin cậy của hàng triệu bệnh nhân.</p>\n<p>Bệnh viện Đa khoa Hồng Ngọc hiện nay có gần 500 giường bệnh; 25 khoa phòng cùng đội ngũ 200 bác sĩ; 430 y tá, điều dưỡng và kỹ thuật viên. Tất cả đều có chuyên môn cao, giàu kinh nghiệm, đáp ứng nhu cầu khám chữa bệnh khắt khe của toàn thể khách hàng. Đặc biệt, để đáp ứng nhu cầu thăm khám ngày càng tăng cao của người dân thủ đô cũng như của các tỉnh thành lân cận, Bệnh viện Đa khoa Hồng Ngọc đã xây dựng thêm 5 phòng khám vệ tinh cùng 1 bệnh viên mới 16 tầng hiện đại, cung cấp các dịch vụ y tế chất lượng cao, gồm:</p>\n<ul>\n<li>\n<p>Bệnh viện Đa khoa Hồng Ngọc Yên Ninh</p>\n</li>\n<li>\n<p>Phòng khám Đa khoa Hồng Ngọc Keangnam</p>\n</li>\n<li>\n<p>Phòng khám Đa khoa Hồng Ngọc Savico</p>\n</li>\n<li>\n<p>Phòng khám Đa khoa Hồng Ngọc – Nguyễn Tuân</p>\n</li>\n<li>\n<p>Phòng khám Đa khoa Hồng Ngọc – Tố Hữu</p>\n</li>\n<li>\n<p>Phòng khám Đa khoa Hồng Ngọc Tây Hồ</p>\n</li>\n<li>\n<p>Bệnh viện Đa khoa Hồng Ngọc Phúc Trường Minh</p>\n</li>\n</ul>\n', '\n### **GIỚI THIỆU**\n\nHệ thống Bệnh viện Đa khoa Hồng Ngọc được xây dựng với mô hình bệnh viện – khách sạn tiên phong ở Hà Nội cũng như toàn khu vực miền Bắc. Đến nay, trải qua gần 20 năm xây dựng và phát triển, Hồng Ngọc đã trở thành thương hiệu quen thuộc và là địa chỉ y tế đáng tin cậy của hàng triệu bệnh nhân.\n\nBệnh viện Đa khoa Hồng Ngọc hiện nay có gần 500 giường bệnh; 25 khoa phòng cùng đội ngũ 200 bác sĩ; 430 y tá, điều dưỡng và kỹ thuật viên. Tất cả đều có chuyên môn cao, giàu kinh nghiệm, đáp ứng nhu cầu khám chữa bệnh khắt khe của toàn thể khách hàng. Đặc biệt, để đáp ứng nhu cầu thăm khám ngày càng tăng cao của người dân thủ đô cũng như của các tỉnh thành lân cận, Bệnh viện Đa khoa Hồng Ngọc đã xây dựng thêm 5 phòng khám vệ tinh cùng 1 bệnh viên mới 16 tầng hiện đại, cung cấp các dịch vụ y tế chất lượng cao, gồm:\n\n* Bệnh viện Đa khoa Hồng Ngọc Yên Ninh\n\n* Phòng khám Đa khoa Hồng Ngọc Keangnam\n\n* Phòng khám Đa khoa Hồng Ngọc Savico\n\n* Phòng khám Đa khoa Hồng Ngọc – Nguyễn Tuân\n\n* Phòng khám Đa khoa Hồng Ngọc – Tố Hữu\n\n* Phòng khám Đa khoa Hồng Ngọc Tây Hồ\n\n* Bệnh viện Đa khoa Hồng Ngọc Phúc Trường Minh', , '2024-06-04 14:19:22', '2024-06-04 14:19:22');
INSERT INTO `Clinics` (`id`, `name`, `address`, `descriptionHTML`, `desciptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(3, 'Phòng khám Da liễu Hà Nội', '447 Hoàng Quốc Việt, Cổ Nhuế, Bắc Từ Liêm, Hà Nội', '<h3><strong>GIỚI THIỆU CHUNG</strong></h3>\n<p><strong>Phòng khám Da liễu Hà Nội</strong> được thành lập từ năm 2010 do Sở Y tế cấp phép hoạt động.</p>\n<p><strong>Phòng khám có thế mạnh về Trị mụn y khoa, trị thâm do mụn, trị sẹo rỗ sau mụn</strong></p>\n<p><strong>Các bác sĩ tại phòng khám có kinh nghiệm và chuyên môn cao sẽ trực tiếp thăm khám, lên phác đồ điều trị và trực tiếp trị liệu cho bệnh nhân</strong></p>\n<p><strong>Quy trình trị liệu chuẩn y khoa:</strong></p>\n<ul>\n<li>\n<p>Mỗi khách hàng trước tiến hành điều trị sẽ được Bác sĩ thăm khám, xem xét mức độ tình trạng của từng bệnh nhân để lên phác đồ điều trị hiệu quả và phù hợp với cơ địa</p>\n</li>\n<li>\n<p>Các dụng cụ và phòng trị liệu của phòng khám luôn được vệ sinh và tiệt trùng sạch sẽ</p>\n</li>\n<li>\n<p>Các sản phẩm được sử dụng trong trị liệu có nguồn gốc xuất xứ rõ ràng, được sự kiểm chứng chất lượng của Bộ Y tế về an toàn và hiệu quả</p>\n</li>\n</ul>\n', '\n### **GIỚI THIỆU CHUNG**\n\n**Phòng khám Da liễu Hà Nội** được thành lập từ năm 2010 do Sở Y tế cấp phép hoạt động.\n\n**Phòng khám có thế mạnh về Trị mụn y khoa, trị thâm do mụn, trị sẹo rỗ sau mụn**\n\n**Các bác sĩ tại phòng khám có kinh nghiệm và chuyên môn cao sẽ trực tiếp thăm khám, lên phác đồ điều trị và trực tiếp trị liệu cho bệnh nhân**\n\n**Quy trình trị liệu chuẩn y khoa:**\n\n* Mỗi khách hàng trước tiến hành điều trị sẽ được Bác sĩ thăm khám, xem xét mức độ tình trạng của từng bệnh nhân để lên phác đồ điều trị hiệu quả và phù hợp với cơ địa\n\n* Các dụng cụ và phòng trị liệu của phòng khám luôn được vệ sinh và tiệt trùng sạch sẽ\n\n* Các sản phẩm được sử dụng trong trị liệu có nguồn gốc xuất xứ rõ ràng, được sự kiểm chứng chất lượng của Bộ Y tế về an toàn và hiệu quả ', , '2024-06-04 14:22:16', '2024-06-04 14:22:16');
INSERT INTO `Clinics` (`id`, `name`, `address`, `descriptionHTML`, `desciptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(4, 'Bệnh viện Ung bướu Hưng Việt', '34 Đại Cồ Việt, Hai Bà Trưng, Hà Nội', '<h3><strong>GIỚI THIỆU</strong></h3>\n<p><strong>Bệnh viện Ung Bướu Hưng Việt</strong> là bệnh viện chuyên khoa Ung Bướu tư nhân đầu tiên tại Việt Nam. Bệnh viện được định hướng phát triển thành đơn vị chăm sóc sức khỏe toàn diện sánh ngang với các bệnh viện trong khu vực và quốc tế.</p>\n<p>Điểm đặc biệt của bệnh viện, đội ngũ bác sĩ trực tiếp thăm khám đều là các chuyên gia đầu ngành, trưởng phó khoa của các bệnh viện lớn, chuyên sâu điều trị ung bướu: Bệnh viện K Trung ương, Bệnh viện Bạch Mai, Bệnh viện Việt Đức,... Hơn nữa, hệ thống trang thiết bị hỗ trợ khám và điều trị ung bướu được biệt viện chú trọng đầu tư, mang lại sự thuận tiện và hiệu quả tối ưu cho quá trình điều trị ung bướu.</p>\n<p>Sự kết hợp của đội ngũ bác sĩ giỏi cùng hệ thống trang thiết bị được đầu tư, thông tin bác sĩ rõ ràng, người bệnh có thể dễ dàng đặt hẹn với bác sĩ mong muốn cùng sự hỗ trợ tận tình của đội ngũ nhân viên, Bệnh viện Hưng Việt đã trở thành địa chỉ khám và điều trị ung bướu tin cậy được nhiều người lựa chọn.</p>\n<p><strong>Địa chỉ</strong>: Số 34 Đường Đại Cồ Việt, Hai Bà Trưng, Hà Nội</p>\n<p><strong>Thời gian làm việc</strong>: Tất cả các ngày trong tuần (kể cả ngày lễ Tết)</p>\n<ul>\n<li>\n<p>Buổi sáng: 07h00 - 12h00</p>\n</li>\n<li>\n<p>Buổi chiều: 13h30 - 17h00</p>\n</li>\n</ul>\n', '\n### **GIỚI THIỆU**\n\n**Bệnh viện Ung Bướu Hưng Việt** là bệnh viện chuyên khoa Ung Bướu tư nhân đầu tiên tại Việt Nam. Bệnh viện được định hướng phát triển thành đơn vị chăm sóc sức khỏe toàn diện sánh ngang với các bệnh viện trong khu vực và quốc tế. \n\nĐiểm đặc biệt của bệnh viện, đội ngũ bác sĩ trực tiếp thăm khám đều là các chuyên gia đầu ngành, trưởng phó khoa của các bệnh viện lớn, chuyên sâu điều trị ung bướu: Bệnh viện K Trung ương, Bệnh viện Bạch Mai, Bệnh viện Việt Đức,... Hơn nữa, hệ thống trang thiết bị hỗ trợ khám và điều trị ung bướu được biệt viện chú trọng đầu tư, mang lại sự thuận tiện và hiệu quả tối ưu cho quá trình điều trị ung bướu.\n\nSự kết hợp của đội ngũ bác sĩ giỏi cùng hệ thống trang thiết bị được đầu tư, thông tin bác sĩ rõ ràng, người bệnh có thể dễ dàng đặt hẹn với bác sĩ mong muốn cùng sự hỗ trợ tận tình của đội ngũ nhân viên, Bệnh viện Hưng Việt đã trở thành địa chỉ khám và điều trị ung bướu tin cậy được nhiều người lựa chọn.\n\n**Địa chỉ**: Số 34 Đường Đại Cồ Việt, Hai Bà Trưng, Hà Nội\n\n**Thời gian làm việc**: Tất cả các ngày trong tuần (kể cả ngày lễ Tết)\n\n* Buổi sáng: 07h00 - 12h00\n\n* Buổi chiều: 13h30 - 17h00', , '2024-06-04 14:24:47', '2024-06-04 14:24:47');
