(5, 'Bệnh viện Mắt Hà Nội 2', '72 Nguyễn Chí Thanh, Phường Láng Thượng, Đống Đa, Hà Nội', '<h3><strong>GIỚI THIỆU CHUNG</strong></h3>\n<p><strong>Bệnh viện Mắt Hà Nội 2</strong> được thành lập từ năm 2017, hiện đã và đang là một trong những bệnh viện chuyên khoa Mắt hàng đầu Việt Nam với chuyên môn lâm sàng, quy trình khám và điều trị khắt khe, đảm bảo tiêu chuẩn an toàn tốt nhất cho bệnh nhân. Mắt Hà Nội 2 tự hào là một trong số các bệnh viện đầu tiên ngoài nước Pháp triển khai tiêu chuẩn quản lý chất lượng HAS nghiêm ngặt bậc nhất Thế giới. Và là cơ sở thực hành của Đại học Y Hà Nội, thực hiện đào tạo bác sĩ, chuyên gia nhãn khoa cho cả nước.</p>\n<p><strong>Đội ngũ y bác sĩ có chuyên môn sâu về nhãn khoa, là các chuyên gia hàng đầu trên toàn quốc và trong khu vực.</strong></p>\n<ul>\n<li>\n<p>Phó Giáo sư, Tiến sĩ Hoàng Thị Minh Châu</p>\n<ul>\n<li>\n<p>40 năm kinh nghiệm trong khám và điều trị các bệnh lý về mắt</p>\n</li>\n<li>\n<p>Nguyên Phó Giám đốc Bệnh viện Mắt Trung ương</p>\n</li>\n<li>\n<p>Phó Chủ tịch Hội Nhãn khoa Việt Nam</p>\n</li>\n</ul>\n</li>\n<li>\n<p>Phó Giáo sư, Tiến sĩ Nguyễn Đức Anh</p>\n<ul>\n<li>\n<p>Trên 35 năm kinh nghiệm chuyên môn</p>\n</li>\n<li>\n<p>Giảng viên nhãn khoa tại viện Karolinska (Thụy Điển)</p>\n</li>\n<li>\n<p>Giảng viên cao cấp bộ môn Mắt trường Đại học Y Hà Nội</p>\n</li>\n</ul>\n</li>\n<li>\n<p>Thạc sĩ, Bác sĩ Mai Thị Anh Thư</p>\n<ul>\n<li>\n<p>10 năm kinh nghiệm trong ngành nhãn khoa</p>\n</li>\n<li>\n<p>Trưởng Khoa Khám bệnh - Bệnh viện Mắt Hà Nội 2</p>\n</li>\n</ul>\n</li>\n<li>\n<p>Bác sĩ Chuyên khoa I Nguyễn Thị Thúy Nga</p>\n<ul>\n<li>\n<p>Gần 20 năm kinh nghiệm trong ngành nhãn khoa</p>\n</li>\n<li>\n<p>Phó Trưởng khoa Khúc xạ - Bệnh viện Mắt Hà Nội 2</p>\n</li>\n</ul>\n</li>\n</ul>\n', '\n### **GIỚI THIỆU CHUNG**\n\n**Bệnh viện Mắt Hà Nội 2** được thành lập từ năm 2017, hiện đã và đang là một trong những bệnh viện chuyên khoa Mắt hàng đầu Việt Nam với chuyên môn lâm sàng, quy trình khám và điều trị khắt khe, đảm bảo tiêu chuẩn an toàn tốt nhất cho bệnh nhân. Mắt Hà Nội 2 tự hào là một trong số các bệnh viện đầu tiên ngoài nước Pháp triển khai tiêu chuẩn quản lý chất lượng HAS nghiêm ngặt bậc nhất Thế giới. Và là cơ sở thực hành của Đại học Y Hà Nội, thực hiện đào tạo bác sĩ, chuyên gia nhãn khoa cho cả nước.\n\n**Đội ngũ y bác sĩ có chuyên môn sâu về nhãn khoa, là các chuyên gia hàng đầu trên toàn quốc và trong khu vực.**\n\n* Phó Giáo sư, Tiến sĩ Hoàng Thị Minh Châu\n\n  * 40 năm kinh nghiệm trong khám và điều trị các bệnh lý về mắt\n\n  * Nguyên Phó Giám đốc Bệnh viện Mắt Trung ương\n\n  * Phó Chủ tịch Hội Nhãn khoa Việt Nam\n\n* Phó Giáo sư, Tiến sĩ Nguyễn Đức Anh\n\n  * Trên 35 năm kinh nghiệm chuyên môn\n\n  * Giảng viên nhãn khoa tại viện Karolinska (Thụy Điển)\n\n  * Giảng viên cao cấp bộ môn Mắt trường Đại học Y Hà Nội\n\n* Thạc sĩ, Bác sĩ Mai Thị Anh Thư\n\n  * 10 năm kinh nghiệm trong ngành nhãn khoa\n\n  * Trưởng Khoa Khám bệnh - Bệnh viện Mắt Hà Nội 2\n\n* Bác sĩ Chuyên khoa I Nguyễn Thị Thúy Nga\n\n  * Gần 20 năm kinh nghiệm trong ngành nhãn khoa\n\n  * Phó Trưởng khoa Khúc xạ - Bệnh viện Mắt Hà Nội 2', , '2024-06-04 14:29:38', '2024-06-04 14:29:38');
INSERT INTO `Clinics` (`id`, `name`, `address`, `descriptionHTML`, `desciptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(6, 'Nha khoa Hoa Hồng Phương Đông', '166 đường Đồng Văn Cống, Phường Thạnh Mỹ Lợi, Quận 2, Tp. HCM', '<h3><strong>GIỚI THIỆU CHUNG</strong></h3>\n<p><strong>Nha khoa Hoa Hồng Phương Đông</strong> – Since 2000 - 2nd All On 4 Viet Nam tiền thân là Nha khoa Hoa Hoa Hồng – là nha khoa chuyên về răng sứ - cấy ghép Implant. Với bề dày kinh nghiệm hơn 23 năm hoạt động, Nha khoa Hoa Hồng Phương Đông đã trở thành cái tên quen thuộc đối với các khách hàng trong và ngoài nước. Được định vị là nha khoa điều trị chất lượng cao với chi phí hợp lí.</p>\n<p>Nụ cười đẹp và hàm răng chắc khỏe là tài sản và món quà quý giá của cuộc sống. Thấu hiểu chân lý này mà Nha khoa Hoa Hồng Phương Đông luôn đặt lợi ích sức khỏe răng miệng của quý khách lên hàng đầu.</p>\n<p><strong>Đội ngũ bác sĩ giỏi, giàu kinh nghiệm từ 17 đến 26 năm trong nghề</strong>. Các bác sĩ đều tốt nghiệp đại học chính quy khoa Răng-Hàm-Mặt tại trường Đại học Y Dược TP. HCM, từng công tác tại Bệnh viện Răng Hàm Mặt Thành phố Hồ Chí Minh và được tu nghiệp tại các trường đại học hàng đầu Thế giới như Mỹ (Đại học Harvard), Đức, Úc, Nhật Bản... Một số bác sĩ của Phòng khám là:</p>\n<ul>\n<li>\n<p><strong>Bác sĩ Nguyễn Thị Thu Thủy - Bác sĩ Trưởng</strong></p>\n<ul>\n<li>\n<p>Nguyên là bác sĩ của Bệnh viện Răng Hàm Mặt TP. Hồ Chí Minh với hơn 23 năm kinh nghiệm khám – điều trị nha khoa</p>\n</li>\n<li>\n<p>Bác sĩ chuyên cấy ghép Implant, phục hình răng sứ, Phục hình cấy ghép toàn hàm All On 4/All On 6</p>\n</li>\n<li>\n<p>Chuyên gia thẩm mỹ bọc răng sứ / mặt dán sứ veneer</p>\n</li>\n</ul>\n</li>\n<li>\n<p><strong>Bác sĩ Trần Thanh Bình - Chuyên khoa Cấp I</strong></p>\n<ul>\n<li>\n<p>Nguyên là bác sĩ Bệnh viện Răng Hàm Mặt TP. Hồ Chí Minh với hơn 26 năm kinh nghiệm</p>\n</li>\n<li>\n<p>Chuyên gia trong điều trị tủy răng, phục hình răng sứ và cấy ghép implant</p>\n</li>\n</ul>\n</li>\n</ul>\n<p>Nha khoa Hoa Hồng Phương Đông được trang bị máy móc hiên đại, tối tân và quy trình vô trùng cực kỳ nghiêm ngặt giúp việc điều trị nhanh chóng, nhẹ nhàng, thuận tiện và ngăn ngừa lây nhiễm bệnh tuyệt đối.</p>\n<p><strong>Địa chỉ:</strong></p>\n<ul>\n<li>\n<p>Cơ cở 1: Trung tâm vàng bạc đá quý, 30-36 Phan Bội Châu, Lầu 2, Phường Bến Thành, Quận 1, Tp. Hồ Chí Minh</p>\n</li>\n<li>\n<p>Cơ sở 2: 166 đường Đồng Văn Cống, Phường Thạnh Mỹ Lợi, Quận 2, Tp. Hồ Chí Minh</p>\n</li>\n</ul>\n<p><strong>Thời gian làm việc:</strong></p>\n<ul>\n<li>Thứ 2 - Thứ 7: Từ 08h30 đến 18h30</li>\n</ul>\n<p><strong>Hình thức thanh toán</strong>: Tiền mặt, chuyển khoản, quẹt thẻ</p>\n', '\n### **GIỚI THIỆU CHUNG**\n\n\n**Nha khoa Hoa Hồng Phương Đông** – Since 2000 - 2nd All On 4 Viet Nam tiền thân là Nha khoa Hoa Hoa Hồng – là nha khoa chuyên về răng sứ - cấy ghép Implant. Với bề dày kinh nghiệm hơn 23 năm hoạt động, Nha khoa Hoa Hồng Phương Đông đã trở thành cái tên quen thuộc đối với các khách hàng trong và ngoài nước. Được định vị là nha khoa điều trị chất lượng cao với chi phí hợp lí.\n\nNụ cười đẹp và hàm răng chắc khỏe là tài sản và món quà quý giá của cuộc sống. Thấu hiểu chân lý này mà Nha khoa Hoa Hồng Phương Đông luôn đặt lợi ích sức khỏe răng miệng của quý khách lên hàng đầu.\n\n**Đội ngũ bác sĩ giỏi, giàu kinh nghiệm từ 17 đến 26 năm trong nghề**. Các bác sĩ đều tốt nghiệp đại học chính quy khoa Răng-Hàm-Mặt tại trường Đại học Y Dược TP. HCM, từng công tác tại Bệnh viện Răng Hàm Mặt Thành phố Hồ Chí Minh và được tu nghiệp tại các trường đại học hàng đầu Thế giới như Mỹ (Đại học Harvard), Đức, Úc, Nhật Bản... Một số bác sĩ của Phòng khám là:\n\n* **Bác sĩ Nguyễn Thị Thu Thủy - Bác sĩ Trưởng**\n\n  * Nguyên là bác sĩ của Bệnh viện Răng Hàm Mặt TP. Hồ Chí Minh với hơn 23 năm kinh nghiệm khám – điều trị nha khoa\n\n  * Bác sĩ chuyên cấy ghép Implant, phục hình răng sứ, Phục hình cấy ghép toàn hàm All On 4/All On 6\n\n  * Chuyên gia thẩm mỹ bọc răng sứ / mặt dán sứ veneer\n\n* **Bác sĩ Trần Thanh Bình - Chuyên khoa Cấp I**\n\n  * Nguyên là bác sĩ Bệnh viện Răng Hàm Mặt TP. Hồ Chí Minh với hơn 26 năm kinh nghiệm\n\n  * Chuyên gia trong điều trị tủy răng, phục hình răng sứ và cấy ghép implant\n\nNha khoa Hoa Hồng Phương Đông được trang bị máy móc hiên đại, tối tân và quy trình vô trùng cực kỳ nghiêm ngặt giúp việc điều trị nhanh chóng, nhẹ nhàng, thuận tiện và ngăn ngừa lây nhiễm bệnh tuyệt đối.\n\n**Địa chỉ:**\n\n* Cơ cở 1: Trung tâm vàng bạc đá quý, 30-36 Phan Bội Châu, Lầu 2, Phường Bến Thành, Quận 1, Tp. Hồ Chí Minh\n\n* Cơ sở 2: 166 đường Đồng Văn Cống, Phường Thạnh Mỹ Lợi, Quận 2, Tp. Hồ Chí Minh\n\n**Thời gian làm việc:**\n\n* Thứ 2 - Thứ 7: Từ 08h30 đến 18h30\n\n**Hình thức thanh toán**: Tiền mặt, chuyển khoản, quẹt thẻ', , '2024-06-04 14:35:25', '2024-06-04 14:35:25');
INSERT INTO `Clinics` (`id`, `name`, `address`, `descriptionHTML`, `desciptionMarkdown`, `image`, `createdAt`, `updatedAt`) VALUES
(7, 'Hệ thống Y tế Thu Cúc TCI', 'Thụy Khuê: 286 Thụy Khuê, Tây Hồ, Hà Nội', '<h3><strong>GIỚI THIỆU</strong></h3>\n<p>Hệ thống Y tế Thu Cúc TCI tự hào là đơn vị y tế được hàng triệu người dân tin tưởng và Sở Y tế công nhận</p>\n<ul>\n<li>\n<p>Huy chương vàng Dịch vụ y tế do Bộ Y tế trao tặng</p>\n</li>\n<li>\n<p>TOP 3 Bệnh viện tư nhân có điểm chất lượng dẫn đầu Hà Nội</p>\n</li>\n<li>\n<p>TOP 5 bệnh viện có điểm chất lượng cao nhất</p>\n</li>\n<li>\n<p>99% khách hàng đánh giá hài lòng theo thang điểm chấm của Sở Y tế</p>\n</li>\n</ul>\n<p><strong>Hệ thống Y tế Thu Cúc TCI quy tụ đội ngũ bác sĩ gồm đông đảo các Giáo sư, Tiến sĩ, Thạc sĩ, Bác sĩ giỏi chuyên môn và giàu kinh nghiệm.</strong></p>\n<ul>\n<li>\n<p>Đại tá, Phó Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa II, Thầy thuốc nhân dân Nguyễn Văn Quýnh: 40 năm kinh nghiệm trong chuyên khoa Tim mạch. Hơn 30 năm công tác tại Bệnh viện Trung ương Quận đội 108</p>\n</li>\n<li>\n<p>Thầy thuốc ưu tú, Bác sĩ chuyên khoa II Nguyễn Thị Kim Loan: Nguyên Trưởng khoa Cơ xương khớp và Nội tổng hợp Bệnh viện E Hà Nội</p>\n</li>\n<li>\n<p>Tiến sĩ, Bác sĩ Nguyễn Văn Doanh: Nguyên là chủ nhiệm khoa thần kinh, Bệnh viện Hữu Nghị</p>\n</li>\n<li>\n<p>Tiến sĩ, Bác sĩ Nguyễn Thị Thu Hương: Nguyên Phó Giám đốc Bệnh viện Thận Hà Nội. Hơn 30 năm kinh nghiệm khám và chữa các bệnh thận, tiết niệu</p>\n</li>\n<li>\n<p>Phó Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa I, Thầy thuốc nhân dân Nguyễn Xuân Thành: Hơn 30 năm kinh nghiệm trong lĩnh vực gan mật.</p>\n</li>\n<li>\n<p>Và nhiều Phó Giáo sư, Tiến sĩ, Thạc sĩ, Bác sĩ uy tín khác.</p>\n</li>\n</ul>\n<p><strong>Địa chỉ:</strong></p>\n<ul>\n<li>\n<p>Cơ sở Thụy Khuê: 286 Thụy Khuê, Tây Hồ, Hà Nội</p>\n</li>\n<li>\n<p>Cơ sở Trần Duy Hưng: 216 Trần Duy Hưng, Cầu Giấy, Hà Nội</p>\n</li>\n<li>\n<p>Cơ sở Đại Từ: 32 Đại Từ, Hoàng Mai, Hà Nội</p>\n</li>\n<li>\n<p>Cơ sở Nguyễn Trãi: 136 Nguyễn Trãi, Thanh Xuân, Hà Nội</p>\n</li>\n</ul>\n<p><strong>Thời gian làm việc chung:</strong></p>\n<p>Nhằm đáp ứng tối đa nhu cầu thăm khám, điều trị và chăm sóc sức khỏe của đông đảo người bệnh, Hệ thống y tế Thu Cúc TCI triển khai giờ làm việc như sau:</p>\n<ul>\n<li>\n<p><strong>Cơ sở 286 Thụy Khuê</strong>: Từ 6h30 – 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần; Cấp cứu 24/7</p>\n</li>\n<li>\n<p><strong>Cơ sở 216 Trần Duy Hưng</strong>: Từ 7h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần</p>\n</li>\n<li>\n<p><strong>Cơ sở 32 Đại Từ</strong>: Từ 8h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần</p>\n</li>\n<li>\n<p><strong>Cơ sở 136 Nguyễn Trãi</strong>: Từ 8h00 - 17h00 từ Thứ 2 đến CN hàng tuần</p>\n</li>\n</ul>\n', '\n### **GIỚI THIỆU**\n\n\nHệ thống Y tế Thu Cúc TCI tự hào là đơn vị y tế được hàng triệu người dân tin tưởng và Sở Y tế công nhận\n\n* Huy chương vàng Dịch vụ y tế do Bộ Y tế trao tặng\n\n* TOP 3 Bệnh viện tư nhân có điểm chất lượng dẫn đầu Hà Nội\n\n* TOP 5 bệnh viện có điểm chất lượng cao nhất\n\n* 99% khách hàng đánh giá hài lòng theo thang điểm chấm của Sở Y tế\n\n**Hệ thống Y tế Thu Cúc TCI quy tụ đội ngũ bác sĩ gồm đông đảo các Giáo sư, Tiến sĩ, Thạc sĩ, Bác sĩ giỏi chuyên môn và giàu kinh nghiệm.**\n\n* Đại tá, Phó Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa II, Thầy thuốc nhân dân Nguyễn Văn Quýnh: 40 năm kinh nghiệm trong chuyên khoa Tim mạch. Hơn 30 năm công tác tại Bệnh viện Trung ương Quận đội 108\n\n* Thầy thuốc ưu tú, Bác sĩ chuyên khoa II Nguyễn Thị Kim Loan: Nguyên Trưởng khoa Cơ xương khớp và Nội tổng hợp Bệnh viện E Hà Nội\n\n* Tiến sĩ, Bác sĩ Nguyễn Văn Doanh: Nguyên là chủ nhiệm khoa thần kinh, Bệnh viện Hữu Nghị\n\n* Tiến sĩ, Bác sĩ Nguyễn Thị Thu Hương: Nguyên Phó Giám đốc Bệnh viện Thận Hà Nội. Hơn 30 năm kinh nghiệm khám và chữa các bệnh thận, tiết niệu\n\n* Phó Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa I, Thầy thuốc nhân dân Nguyễn Xuân Thành: Hơn 30 năm kinh nghiệm trong lĩnh vực gan mật.\n\n* Và nhiều Phó Giáo sư, Tiến sĩ, Thạc sĩ, Bác sĩ uy tín khác.\n\n**Địa chỉ:**\n\n* Cơ sở Thụy Khuê: 286 Thụy Khuê, Tây Hồ, Hà Nội\n\n* Cơ sở Trần Duy Hưng: 216 Trần Duy Hưng, Cầu Giấy, Hà Nội\n\n* Cơ sở Đại Từ: 32 Đại Từ, Hoàng Mai, Hà Nội\n\n* Cơ sở Nguyễn Trãi: 136 Nguyễn Trãi, Thanh Xuân, Hà Nội\n\n**Thời gian làm việc chung:**\n\nNhằm đáp ứng tối đa nhu cầu thăm khám, điều trị và chăm sóc sức khỏe của đông đảo người bệnh, Hệ thống y tế Thu Cúc TCI triển khai giờ làm việc như sau:\n\n* **Cơ sở 286 Thụy Khuê**: Từ 6h30 – 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần; Cấp cứu 24/7\n\n* **Cơ sở 216 Trần Duy Hưng**: Từ 7h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần\n\n* **Cơ sở 32 Đại Từ**: Từ 8h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần\n\n* **Cơ sở 136 Nguyễn Trãi**: Từ 8h00 - 17h00 từ Thứ 2 đến CN hàng tuần', , '2024-06-04 14:41:21', '2024-06-04 14:41:21');

