INSERT INTO `Markdowns` (`id`, `contentHTML`, `contentMarkdown`, `description`, `doctorId`, `specialtyId`, `clinicId`, `createdAt`, `updatedAt`) VALUES
(1, '<h3><strong>Thạc sĩ, Bác sĩ Đinh Hữu Việt</strong></h3>\n<ul>\n<li>\n<p>Bác sĩ Chuyên khoa Ngoại và Nam học, Bệnh viện Nam học và Hiếm muộn</p>\n</li>\n<li>\n<p>Bác sĩ nhận khám mọi độ tuổi</p>\n</li>\n</ul>\n<h3><strong>Khám và điều trị</strong></h3>\n<h3><strong>Nam học và Giới tính (Andrology &amp; Sexology):</strong></h3>\n<ul>\n<li>\n<p>Rối loạn cương dương (ED: Erectile Disfunction); rối loạn khoái cảm; rối loạn xuất tinh, không xuất tinh, xuất tinh sớm, xuất tinh ngược dòng; không quan hệ tình dục được; cương cứng liên tục…</p>\n</li>\n<li>\n<p>Những dị tật bẩm sinh Hệ sinh sản: bất thường về nhiễm sắc thể; lưỡng giới; tinh hoàn ẩn, lạc chỗ; dương vật dị dạng vẹo, xoắn, bé, có màng, tụt vào trong, lệch lỗ đái…</p>\n</li>\n<li>\n<p>Bệnh mắc phải của Hệ sinh sản: chấn thương gẫy dương vật; xoắn tinh hoàn; tràn dịch màng tinh hoàn; khối u; viêm nhiễm bộ phận sinh dục…</p>\n</li>\n<li>\n<p>Chữa giãn tĩnh mạch tinh – nguyên nhân hàng đầu của vô sinh nam bằng phương pháp vi phẫu.</p>\n</li>\n<li>\n<p>Khám và điều trị các bệnh lý về rối loạn sinh lý tình dục nữ như: rối loạn cảm xúc tình dục, lãnh cảm tình dục…</p>\n</li>\n</ul>\n<h3><strong>Khám và điều trị bệnh lý hệ sinh sản Nam:</strong></h3>\n<ul>\n<li>\n<p>Vô sinh nam: không tinh trùng; tinh trùng ít, chết, dị dạng; không ống dẫn tinh; tắc ống dẫn tinh; rối loạn nội tiết; rối loạn sinh tinh; …</p>\n</li>\n<li>\n<p>Phẫu thuật điều trị các bệnh lý nam khoa : nối ống dẫn tinh sau triệt sản, giãn tĩnh mạch tinh, tinh hoàn lạc chỗ…</p>\n</li>\n<li>\n<p>Phẫu thuật tạo hình hệ sinh sản</p>\n</li>\n</ul>\n<h3><strong>Quá trình công tác</strong></h3>\n<ul>\n<li>Hiện là Bác sĩ Chuyên khoa Ngoại và Nam học, Bệnh viện Nam học và Hiếm muộn</li>\n</ul>\n<h3><strong>Quá trình đào tạo</strong></h3>\n<ul>\n<li>\n<p>Tốt nghiệp Bác sĩ Y khoa, Đại học Y Thái Nguyên</p>\n</li>\n<li>\n<p>Hoàn thành khóa Đào tạo Phẫu thuật Tiết niệu tại Đại học Y Hà Nội (2014)</p>\n</li>\n<li>\n<p>Tốt nghiệp Thạc sĩ chuyên ngành Nam khoa và Ngoại Tiết Niệu tại Đại học Y Hà Nội</p>\n</li>\n<li>\n<p>Tham dự nhiều khóa học chuyên sâu về Ngoại khoa, Nam khoa và Y học giới tính ở trong và ngoài nước</p>\n</li>\n</ul>\n', '\n### **Thạc sĩ, Bác sĩ Đinh Hữu Việt**\n\n\n* Bác sĩ Chuyên khoa Ngoại và Nam học, Bệnh viện Nam học và Hiếm muộn\n\n* Bác sĩ nhận khám mọi độ tuổi\n\n\n### **Khám và điều trị**\n\n\n\n### **Nam học và Giới tính (Andrology & Sexology):**\n\n\n* Rối loạn cương dương (ED: Erectile Disfunction); rối loạn khoái cảm; rối loạn xuất tinh, không xuất tinh, xuất tinh sớm, xuất tinh ngược dòng; không quan hệ tình dục được; cương cứng liên tục…\n\n* Những dị tật bẩm sinh Hệ sinh sản: bất thường về nhiễm sắc thể; lưỡng giới; tinh hoàn ẩn, lạc chỗ; dương vật dị dạng vẹo, xoắn, bé, có màng, tụt vào trong, lệch lỗ đái…\n\n* Bệnh mắc phải của Hệ sinh sản: chấn thương gẫy dương vật; xoắn tinh hoàn; tràn dịch màng tinh hoàn; khối u; viêm nhiễm bộ phận sinh dục…\n\n* Chữa giãn tĩnh mạch tinh – nguyên nhân hàng đầu của vô sinh nam bằng phương pháp vi phẫu.\n\n* Khám và điều trị các bệnh lý về rối loạn sinh lý tình dục nữ như: rối loạn cảm xúc tình dục, lãnh cảm tình dục…\n\n\n### **Khám và điều trị bệnh lý hệ sinh sản Nam:**\n\n\n* Vô sinh nam: không tinh trùng; tinh trùng ít, chết, dị dạng; không ống dẫn tinh; tắc ống dẫn tinh; rối loạn nội tiết; rối loạn sinh tinh; …\n\n* Phẫu thuật điều trị các bệnh lý nam khoa : nối ống dẫn tinh sau triệt sản, giãn tĩnh mạch tinh, tinh hoàn lạc chỗ…\n\n* Phẫu thuật tạo hình hệ sinh sản\n\n\n### **Quá trình công tác**\n\n\n* Hiện là Bác sĩ Chuyên khoa Ngoại và Nam học, Bệnh viện Nam học và Hiếm muộn\n\n\n### **Quá trình đào tạo**\n\n\n* Tốt nghiệp Bác sĩ Y khoa, Đại học Y Thái Nguyên\n\n* Hoàn thành khóa Đào tạo Phẫu thuật Tiết niệu tại Đại học Y Hà Nội (2014)\n\n* Tốt nghiệp Thạc sĩ chuyên ngành Nam khoa và Ngoại Tiết Niệu tại Đại học Y Hà Nội \n\n* Tham dự nhiều khóa học chuyên sâu về Ngoại khoa, Nam khoa và Y học giới tính ở trong và ngoài nước', 'Bác sĩ Chuyên khoa Ngoại và Nam học, Bệnh viện Nam học và Hiếm muộn\nBác sĩ nhận khám mọi độ tuổi ', 9, NULL, NULL, '2024-05-22 08:08:53', '2024-05-23 18:06:54'),
(2, '<h3><strong>Bác sĩ Chuyên khoa I Nguyễn Thị Thanh Xuân</strong></h3>\n<ul>\n<li>\n<p>20 năm kinh nghiệm lĩnh vực Nội Tim mạch</p>\n</li>\n<li>\n<p>Nguyên Phó trưởng khoa Tim mạch - Bệnh viện 30/4 TP. HCM</p>\n</li>\n<li>\n<p>Hiện công tác tại Bệnh viện Gia An 115</p>\n</li>\n</ul>\n<h3><strong>Khám và điều trị</strong></h3>\n<ul>\n<li>\n<p>Khám, tư vấn, điều trị chuyên sâu các bệnh về Tim mạch:</p>\n</li>\n<li>\n<p>Xơ vữa – hẹp động mạch vành, động mạch cảnh</p>\n</li>\n<li>\n<p>Tai biến mạch máu não, suy tim</p>\n</li>\n<li>\n<p>Các bệnh tim bẩm sinh của trẻ em và người lớn</p>\n</li>\n<li>\n<p>Các bệnh về mạch máu; xơ vữa, phình động mạch chủ ngực, động mạch chủ bụng, can thiệp tim mạch và can\nthiệp mạch máu ngoại biên</p>\n</li>\n<li>\n<p>Nhịp tim không đều (loạn nhịp tim)</p>\n</li>\n<li>\n<p>Khuyết tật tim bẩm sinh</p>\n</li>\n<li>\n<p>Vấn đề về van tim</p>\n</li>\n<li>\n<p>Nhiễm trùng tim</p>\n</li>\n<li>\n<p>...</p>\n</li>\n</ul>\n<h3><strong>Quá trình công tác</strong></h3>\n<ul>\n<li>\n<p>Bác sĩ điều trị khoa Nội - Bệnh viện Gia An 115 (2019 - Nay)</p>\n</li>\n<li>\n<p>Bác sĩ điều trị khoa Nội - Bệnh viện An Sinh TP. HCM (2017 - 2018)</p>\n</li>\n<li>\n<p>Phó Trưởng khoa Tim Mạch - Bệnh viện 30/4 TP. HCM (2015 - 2017)</p>\n</li>\n<li>\n<p>Bác sĩ điều trị tại khoa Nội Tim mạch Thận khớp - Bệnh viện 30/4 TP. HCM (2003 - 2016)</p>\n</li>\n</ul>\n<h3><strong>Quá trình đào tạo</strong></h3>\n<ul>\n<li>\n<p>Chuyên khoa I Nội tổng quát - Đại học Y Dược TP. HCM (2010 - 2012)</p>\n</li>\n<li>\n<p>Bác sĩ Đa khoa - Đại học Y Dược Thái Bình (2002)</p>\n</li>\n</ul>\n<h3><strong>Chứng chỉ trong và ngoài nước</strong></h3>\n<ul>\n<li>\n<p>Siêu âm tim - Bệnh viện Chợ Rẫy (2017)</p>\n</li>\n<li>\n<p>Đào tạo thực hành tim mạch - Bệnh viện Cathay, Đài Loan (2013)</p>\n</li>\n<li>\n<p>Bệnh học và điều trị cơ xương khớp - Đại học Y Dược TP HCM (2011)</p>\n</li>\n<li>\n<p>Thực hành đọc điện tâm đồ và siêu âm tim - Bệnh viện Thống Nhất kết hợp Đại học Y Dược TP. HCM (2008)