(6, '<h3><strong>Thạc sĩ, Bác sĩ Nguyễn Thị Thanh Hà</strong></h3>\n<p>Gần 15 năm kinh nghiệm trong lĩnh vực Tim mạch</p>\n<p>Từng công tác tại khoa Hồi sức Tim và phẫu thuật Tim mạch tại Bệnh viện Chợ Rẫy</p>\n<p>Phó Giám Đốc Trung tâm Ningen Dock Bernad</p>\n<p>Bác sĩ nhận khám từ 15 tuổi trở lên</p>\n<h3><strong>Khám và điều trị</strong></h3>\n<ul>\n<li>\n<p>Thăm khám và điều trị các bệnh lý Tim mạch:</p>\n<ul>\n<li>\n<p>Van tim</p>\n</li>\n<li>\n<p>Mạch vành</p>\n</li>\n<li>\n<p>Rối loạn nhịp</p>\n</li>\n<li>\n<p>Siêu âm tim qua thực quản đánh giá các bệnh lý hở van tim khó</p>\n</li>\n</ul>\n</li>\n<li>\n<p>Chẩn đoán bệnh lý chuyển hóa và các yếu tố nguy cơ tim mạch</p>\n</li>\n<li>\n<p>Kiểm tra sức khỏe</p>\n</li>\n<li>\n<p>Chóng mặt</p>\n</li>\n<li>\n<p>Mệt mỏi</p>\n</li>\n<li>\n<p>Hoa mắt</p>\n</li>\n<li>\n<p>Kém ăn</p>\n</li>\n<li>\n<p>Giảm sút cân</p>\n</li>\n<li>\n<p>Khó ngủ</p>\n</li>\n<li>\n<p>Đau đầu</p>\n</li>\n<li>\n<p>Ngộ độc rượu</p>\n</li>\n<li>\n<p>Ngộ độc thức ăn</p>\n</li>\n<li>\n<p>Dị ứng</p>\n</li>\n<li>\n<p>Viêm da dị ứng</p>\n</li>\n<li>\n<p>Dị ứng thực phẩm</p>\n</li>\n<li>\n<p>Rối loạn miễn dịch</p>\n</li>\n<li>\n<p>Rối loạn chuyển hóa</p>\n</li>\n</ul>\n<h3><strong>Quá trình công tác</strong></h3>\n<ul>\n<li>\n<p>Phó Giám Đốc Trung tâm Ningen Dock Bernad</p>\n</li>\n<li>\n<p>Từng công tác tại khoa Hồi sức Tim và phẫu thuật Tim mạch tại Bệnh viện Chợ Rẫy</p>\n</li>\n<li>\n<p>Trung tâm kiểm tra Sức khỏe Chợ Rẫy Việt - Nhật (HECI)</p>\n</li>\n</ul>\n', '\n### **Thạc sĩ, Bác sĩ Nguyễn Thị Thanh Hà**\n\nGần 15 năm kinh nghiệm trong lĩnh vực Tim mạch\n\nTừng công tác tại khoa Hồi sức Tim và phẫu thuật Tim mạch tại Bệnh viện Chợ Rẫy\n\nPhó Giám Đốc Trung tâm Ningen Dock Bernad\n\nBác sĩ nhận khám từ 15 tuổi trở lên\n\n### **Khám và điều trị**\n\n* Thăm khám và điều trị các bệnh lý Tim mạch:\n\n   * Van tim\n\n  * Mạch vành\n\n  * Rối loạn nhịp\n\n  * Siêu âm tim qua thực quản đánh giá các bệnh lý hở van tim khó \n\n* Chẩn đoán bệnh lý chuyển hóa và các yếu tố nguy cơ tim mạch \n\n* Kiểm tra sức khỏe\n\n* Chóng mặt\n\n* Mệt mỏi\n\n* Hoa mắt\n\n* Kém ăn\n\n* Giảm sút cân\n\n* Khó ngủ\n\n* Đau đầu\n\n* Ngộ độc rượu\n\n* Ngộ độc thức ăn\n\n* Dị ứng\n\n* Viêm da dị ứng\n\n* Dị ứng thực phẩm\n\n* Rối loạn miễn dịch\n\n* Rối loạn chuyển hóa\n\n\n### **Quá trình công tác**\n\n\n* Phó Giám Đốc Trung tâm Ningen Dock Bernad\n\n* Từng công tác tại khoa Hồi sức Tim và phẫu thuật Tim mạch tại Bệnh viện Chợ Rẫy\n\n* Trung tâm kiểm tra Sức khỏe Chợ Rẫy Việt - Nhật (HECI) ', 'Gần 15 năm kinh nghiệm trong lĩnh vực Tim mạch \nTừng công tác tại khoa Hồi sức Tim và phẫu thuật Tim mạch tại Bệnh viện Chợ Rẫy \nPhó Giám Đốc Trung tâm Ningen Dock Bernad', 26, NULL, NULL, '2024-05-23 11:10:31', '2024-05-28 09:49:42'),
(7, '<h3><strong>Giáo sư, Tiến sĩ Thái Hồng Quang</strong></h3>\n<ul>\n<li>\n<p>Chuyên gia đầu ngành về Nội tiết - Đái tháo đường</p>\n</li>\n<li>\n<p>Nguyên Viện trưởng Bệnh viện 103 - Học viện Quân Y</p>\n</li>\n<li>\n<p>Chủ tịch Hội Nội tiết – Đái tháo đường Việt Nam</p>\n</li>\n<li>\n<p>Bác sĩ nhận khám từ 15 tuổi trở lên</p>\n</li>\n</ul>\n<h3><strong>Quá trình công tác</strong></h3>\n<ul>\n<li>\n<p>Nguyên Viện trưởng Bệnh viện 103 – Học viện Quân Y</p>\n</li>\n<li>\n<p>Chủ nhiệm Bộ môn Nội – Học viện Quân Y</p>\n</li>\n</ul>\n<h3><strong>Quá trình đào tạo</strong></h3>\n<ul>\n<li>\n<p>Tốt nghiệp Đại học Y- Dược Hà Nội năm 1965</p>\n</li>\n<li>\n<p>Học chuyên ngành “Nội tiết” tại Học viện Y học Kirov Leningrad (Liên Xô cũ) (1967 - 1970)</p>\n</li>\n<li>\n<p>Bảo vệ thành công luận án Tiến sĩ Y học năm 1989</p>\n</li>\n</ul>\n<h3><strong>Chứng chỉ trong nước hoặc nước ngoài</strong></h3>\n<ul>\n<li>\n<p>Nhà nước phong học hàm Phó Giáo sư năm 1991</p>\n</li>\n<li>\n<p>Nhà nước phong học hàm Giáo sư năm 1996</p>\n</li>\n</ul>\n<h3><strong>Thành viên các Hội khoa học, tổ chức chuyên môn</strong></h3>\n<p>Chủ tịch Hội Nội tiết – Đái tháo đường Việt Nam.</p>\n<ul>\n<li>\n<p>Chủ tịch Hội Nội tiết – Đái tháo đường Hà Nội.</p>\n</li>\n<li>\n<p>Uỷ viên Hội đồng khoa học Cục Quân Y (Phó tiểu ban Nội)</p>\n</li>\n<li>\n<p>Uỷ viên ban chấp hành Hội Nội khoa Việt Nam</p>\n</li>\n<li>\n<p>Uỷ viên Hội Tim mạch học Việt Nam</p>\n</li>\n<li>\n<p>Tổng biên tập Tạp chí “Nội tiết Đái tháo đường Việt Nam”</p>\n</li>\n</ul>\n<h3><strong>Sách và các công trình nghiên cứu, báo cáo khoa học</strong></h3>\n<ul>\n<li>\n<p>Tác giả sách Bệnh nội tiết, Xuất bản ở Học viện Quân Y năm 1989</p>\n</li>\n<li>\n<p>Tác giả sáchThực hành lâm sàng bệnh Nội tiết, năm 2012</p>\n</li>\n</ul>\n<h3><strong>Giáo sư khám &amp; điều trị</strong></h3>\n<p>Giáo sư khám và điều trị các bệnh về Nội tiết</p>\n<ul>\n<li>\n<p>Đái tháo đường</p>\n</li>\n<li>\n<p>Basedow</p>\n</li>\n<li>\n<p>Bướu cổ</p>\n</li>\n<li>\n<p>Cường cận giáp</p>\n</li>\n<li>\n<p>Suy giáp</p>\n</li>\n<li>\n<p>Cường giáp</p>\n</li>\n<li>\n<p>Suy tuyến yên</p>\n</li>\n<li>\n<p>Tăng đường huyết bệnh tiểu đường</p>\n</li>\n<li>\n<p>Hạ đường huyết ở bệnh tiểu đường</p>\n</li>\n<li>\n<p>Tiền tiểu đường</p>\n</li>\n<li>\n<p>Tiểu đường tuýp 1</p>\n</li>\n<li>\n<p>Tiểu đường tuýp 2</p>\n</li>\n<li>\n<p>U tuyến yên</p>\n</li>\n<li>\n<p>Ung thư tuyến giáp</p>\n</li>\n</ul>\n', '\n### **Giáo sư, Tiến sĩ Thái Hồng Quang**\n\n* Chuyên gia đầu ngành về Nội tiết - Đái tháo đường\n\n* Nguyên Viện trưởng Bệnh viện 103 - Học viện Quân Y\n\n* Chủ tịch Hội Nội tiết – Đái tháo đường Việt Nam\n\n* Bác sĩ nhận khám từ 15 tuổi trở lên\n\n### **Quá trình công tác**\n\n* Nguyên Viện trưởng Bệnh viện 103 – Học viện Quân Y\n\n* Chủ nhiệm Bộ môn Nội – Học viện Quân Y\n\n### **Quá trình đào tạo**\n\n* Tốt nghiệp Đại học Y- Dược Hà Nội năm 1965\n\n* Học chuyên ngành “Nội tiết” tại Học viện Y học Kirov Leningrad (Liên Xô cũ) (1967 - 1970)\n\n* Bảo vệ thành công luận án Tiến sĩ Y học năm 1989 \n\n### **Chứng chỉ trong nước hoặc nước ngoài**\n\n* Nhà nước phong học hàm Phó Giáo sư năm 1991\n\n* Nhà nước phong học hàm Giáo sư năm 1996\n\n### **Thành viên các Hội khoa học, tổ chức chuyên môn**\n\nChủ tịch Hội Nội tiết – Đái tháo đường Việt Nam.\n\n* Chủ tịch Hội Nội tiết – Đái tháo đường Hà Nội.\n\n* Uỷ viên Hội đồng khoa học Cục Quân Y (Phó tiểu ban Nội)\n\n* Uỷ viên ban chấp hành Hội Nội khoa Việt Nam\n\n* Uỷ viên Hội Tim mạch học Việt Nam\n\n* Tổng biên tập Tạp chí “Nội tiết Đái tháo đường Việt Nam”\n\n### **Sách và các công trình nghiên cứu, báo cáo khoa học**\n\n* Tác giả sách Bệnh nội tiết, Xuất bản ở Học viện Quân Y năm 1989\n\n* Tác giả sáchThực hành lâm sàng bệnh Nội tiết, năm 2012\n\n### **Giáo sư khám & điều trị**\n\nGiáo sư khám và điều trị các bệnh về Nội tiết\n\n* Đái tháo đường\n\n* Basedow\n\n* Bướu cổ\n\n* Cường cận giáp\n\n* Suy giáp\n\n* Cường giáp\n\n* Suy tuyến yên\n\n* Tăng đường huyết bệnh tiểu đường\n\n* Hạ đường huyết ở bệnh tiểu đường\n\n* Tiền tiểu đường\n\n* Tiểu đường tuýp 1\n\n* Tiểu đường tuýp 2\n\n* U tuyến yên\n\n* Ung thư tuyến giáp', 'Chuyên gia đầu ngành về Nội tiết - Đái tháo đường\nNguyên Viện trưởng Bệnh viện 103 - Học viện Quân Y\nChủ tịch Hội Nội tiết – Đái tháo đường Việt Nam\nBác sĩ nhận khám từ 15 tuổi trở lên ', 25, NULL, NULL, '2024-05-23 11:23:52', '2024-05-23 11:23:52'),
(8, '<h3><strong>Tiến sĩ, Bác sĩ Võ Xuân Sơn</strong></h3>\n<ul>\n<li>\n<p>Bác sĩ từng công tác tại Khoa Ngoại Thần Kinh – Bệnh viện Chợ Rẫy</p>\n</li>\n<li>\n<p>Tốt nghiệp Tiến sĩ Y học, Đại học Y Dược TP. Hồ Chí Minh</p>\n</li>\n<li>\n<p>Bác sĩ nhận khám cho bệnh nhân từ 10 tuổi trở lên</p>\n</li>\n</ul>\n<h3><strong>Khám và điều trị</strong></h3>\n<p>Bác sĩ có kinh nghiệm chuyên sâu trong khám và điều trị, phẫu thuật cột sống ít xâm lấn (xâm lấn tối thiểu. Bác sĩ đã từng thực hiện:</p>\n<ul>\n<li>\n<p>500 ca nội soi cột sống</p>\n</li>\n<li>\n<p>Hơn 300 ca giải ép TLIF và nẹp vít qua da sextant</p>\n</li>\n<li>\n<p>Hơn 1000 ca tạo hình đốt sống và tạo hình gù bằng xi măng sinh học (vertebroplasty và kyphoplasty)</p>\n</li>\n<li>\n<p>Hơn 200 ca mổ đặt dụng cụ cho bệnh nhân loãng xương bằng vít rỗng có bổ sung xi măng sinh học (Omega)</p>\n</li>\n</ul>\n<p>Hàng ngàn các trường hợp vi phẫu thuật khác như:</p>\n<ul>\n<li>\n<p>Vi phẫu thuật giải ép ghép xương lối trước cho thoát vị đĩa đệm cột sống cổ (ACDF)</p>\n</li>\n<li>\n<p>Vi phẫu thuật đặt dụng cụ cho trượt đốt sống</p>\n</li>\n<li>\n<p>Vi phẫu thuật lấy u tủy</p>\n</li>\n<li>\n<p>Vi phẫu thuật tạo hình ống sống trong bệnh lí hẹp ống sống cổ</p>\n</li>\n</ul>\n<h3><strong>Quá trình công tác</strong></h3>\n<ul>\n<li>Khoa Ngoại Thần Kinh – Bệnh viện Chợ Rẫy: bác sĩ trưởng kíp trực, phẫu thuật viên chính, đảm trách những ca mổ khó nhất, đặc biệt là trong lĩnh vực Phẫu thuật Cột sống – Tủy sống</li>\n</ul>\n<h3><strong>Quá trình đào tạo</strong></h3>\n<ul>\n<li>\n<p>Tốt nghiệp Bác sĩ Y khoa, Đại học Y Dược TP. Hồ Chí Minh (1987)</p>\n</li>\n<li>\n<p>Tốt nghiệp Thạc sĩ Y học, Đại học Y Dược TP. Hồ Chí Minh (2000)</p>\n</li>\n<li>\n<p>Bảo vệ thành công luận án Tiến sĩ Y học cấp quốc gia, Đại học Y Dược TP. Hồ Chí Minh (2006)</p>\n</li>\n<li>\n<p>Bác sĩ Xuân Sơn đã tu nghiệp về Phẫu Thuật Cột Sống – Tủy Sống  nhiều lần tại các bệnh viện lớn và các trường đại học hàng đầu tại Nhật Bản, Hoa Kì, Công Hòa Liên Bang Đức, Hàn Quốc…</p>\n</li>\n</ul>\n<h3><strong>Thành viên các Hội khoa học, Tổ chức chuyên môn</strong></h3>\n<ul>\n<li>\n<p>Ủy viên Ban chấp hành Hội Phẫu Thuật Thần Kinh Việt Nam</p>\n</li>\n<li>\n<p>Ủy viên Ban Chấp hành Hội Đau thành phố Hồ Chí Minh.</p>\n</li>\n<li>\n<p>Fellow (thành viên) của Đại học Fujita Health Nhật Bản</p>\n</li>\n<li>\n<p>Fellow (thành viên) của Barrow Neurosurgical Intitute Hoa Kì</p>\n</li>\n<li>\n<p>Hội viên Hội Phẫu thuật Thần kinh Châu Á</p>\n</li>\n<li>\n<p>Thành viên của Liên đoàn Phẫu thuật viên Thần kinh thế giới (WFNS)</p>\n</li>\n<li>\n<p>Hội viên chính thức Hội phẫu thuật cột sống tiên tiến quốc tế (ISASS)</p>\n</li>\n<li>\n<p>Hội viên chính thức Hội Phẫu thuật cột sống Bắc Mỹ (North America Spine Society)</p>\n</li>\n</ul>\n<h3><strong>Quy trình cho người bệnh khám với Tiến sĩ, Bác sĩ Võ Xuân Sơn</strong></h3>\n<h3><strong>Lưu ý:</strong> Quy trình này dành cho người bệnh khám tại Phòng khám Đa khoa Exson.</h3>\n<ul>\n<li>\n<p>Bước 1: Khám ban đầu với một bác sĩ chuyên khoa cột sống</p>\n</li>\n<li>\n<p>Bước 2: Bác sĩ chuyên khoa cột sống chỉ định chụp chiếu, xét nghiệm (nếu cần)</p>\n</li>\n<li>\n<p>Bước 3: Thực hiện các xét nghiệm, chụp chiếu theo chỉ định</p>\n</li>\n<li>\n<p>Bước 4: Người bệnh gặp Tiến sĩ, Bác sĩ Võ Xuân Sơn để đọc kết quả và tư vấn điều trị</p>\n<p>Ghi chú: Bệnh nhân chỉ gặp Tiến sĩ, Bác sĩ Võ Xuân Sơn ở Bước 4 (sau khi đã có kết quả xét nghiệm, chụp chiếu).</p>\n</li>\n</ul>\n<p><strong>Bác sĩ chuyên khoa cột sống thực hiện khám và kiểm tra tình trạng chung cho người bệnh:</strong></p>\n<p>Bác sĩ Chuyên khoa I Ngô Đức Trường</p>\n<ul>\n<li>\n<p>Bác sĩ từng công tác tại Bệnh viện Phương Đông - 79 Thành Thái, P14, Q10, Tp. HCM</p>\n</li>\n<li>\n<p>Bác sĩ có kinh nghiệm trên 25 năm về chuyên khoa Thần kinh - Cột sống</p>\n</li>\n</ul>\n', '\n### **Tiến sĩ, Bác sĩ Võ Xuân Sơn**\n\n\n* Bác sĩ từng công tác tại Khoa Ngoại Thần Kinh – Bệnh viện Chợ Rẫy\n\n* Tốt nghiệp Tiến sĩ Y học, Đại học Y Dược TP. Hồ Chí Minh \n\n* Bác sĩ nhận khám cho bệnh nhân từ 10 tuổi trở lên\n\n\n### **Khám và điều trị**\n\n\nBác sĩ có kinh nghiệm chuyên sâu trong khám và điều trị, phẫu thuật cột sống ít xâm lấn (xâm lấn tối thiểu. Bác sĩ đã từng thực hiện:\n\n* 500 ca nội soi cột sống\n\n* Hơn 300 ca giải ép TLIF và nẹp vít qua da sextant\n\n* Hơn 1000 ca tạo hình đốt sống và tạo hình gù bằng xi măng sinh học (vertebroplasty và kyphoplasty)\n\n* Hơn 200 ca mổ đặt dụng cụ cho bệnh nhân loãng xương bằng vít rỗng có bổ sung xi măng sinh học (Omega)\n\nHàng ngàn các trường hợp vi phẫu thuật khác như:\n\n* Vi phẫu thuật giải ép ghép xương lối trước cho thoát vị đĩa đệm cột sống cổ (ACDF)\n\n* Vi phẫu thuật đặt dụng cụ cho trượt đốt sống\n\n* Vi phẫu thuật lấy u tủy\n\n* Vi phẫu thuật tạo hình ống sống trong bệnh lí hẹp ống sống cổ\n\n\n### **Quá trình công tác**\n\n* Khoa Ngoại Thần Kinh – Bệnh viện Chợ Rẫy: bác sĩ trưởng kíp trực, phẫu thuật viên chính, đảm trách những ca mổ khó nhất, đặc biệt là trong lĩnh vực Phẫu thuật Cột sống – Tủy sống\n\n\n### **Quá trình đào tạo**\n\n* Tốt nghiệp Bác sĩ Y khoa, Đại học Y Dược TP. Hồ Chí Minh (1987)\n\n* Tốt nghiệp Thạc sĩ Y học, Đại học Y Dược TP. Hồ Chí Minh (2000)\n\n* Bảo vệ thành công luận án Tiến sĩ Y học cấp quốc gia, Đại học Y Dược TP. Hồ Chí Minh (2006)\n\n* Bác sĩ Xuân Sơn đã tu nghiệp về Phẫu Thuật Cột Sống – Tủy Sống  nhiều lần tại các bệnh viện lớn và các trường đại học hàng đầu tại Nhật Bản, Hoa Kì, Công Hòa Liên Bang Đức, Hàn Quốc…\n\n\n### **Thành viên các Hội khoa học, Tổ chức chuyên môn**\n\n\n* Ủy viên Ban chấp hành Hội Phẫu Thuật Thần Kinh Việt Nam\n\n* Ủy viên Ban Chấp hành Hội Đau thành phố Hồ Chí Minh.\n\n* Fellow (thành viên) của Đại học Fujita Health Nhật Bản\n\n* Fellow (thành viên) của Barrow Neurosurgical Intitute Hoa Kì\n\n* Hội viên Hội Phẫu thuật Thần kinh Châu Á\n\n* Thành viên của Liên đoàn Phẫu thuật viên Thần kinh thế giới (WFNS)\n\n* Hội viên chính thức Hội phẫu thuật cột sống tiên tiến quốc tế (ISASS)\n\n* Hội viên chính thức Hội Phẫu thuật cột sống Bắc Mỹ (North America Spine Society)\n\n\n### **Quy trình cho người bệnh khám với Tiến sĩ, Bác sĩ Võ Xuân Sơn**\n\n\n\n### **Lưu ý:** Quy trình này dành cho người bệnh khám tại Phòng khám Đa khoa Exson.\n\n\n* Bước 1: Khám ban đầu với một bác sĩ chuyên khoa cột sống\n\n* Bước 2: Bác sĩ chuyên khoa cột sống chỉ định chụp chiếu, xét nghiệm (nếu cần)\n\n* Bước 3: Thực hiện các xét nghiệm, chụp chiếu theo chỉ định\n\n* Bước 4: Người bệnh gặp Tiến sĩ, Bác sĩ Võ Xuân Sơn để đọc kết quả và tư vấn điều trị\n\n  Ghi chú: Bệnh nhân chỉ gặp Tiến sĩ, Bác sĩ Võ Xuân Sơn ở Bước 4 (sau khi đã có kết quả xét nghiệm, chụp chiếu).\n\n**Bác sĩ chuyên khoa cột sống thực hiện khám và kiểm tra tình trạng chung cho người bệnh:**\n\n\nBác sĩ Chuyên khoa I Ngô Đức Trường\n\n* Bác sĩ từng công tác tại Bệnh viện Phương Đông - 79 Thành Thái, P14, Q10, Tp. HCM\n\n* Bác sĩ có kinh nghiệm trên 25 năm về chuyên khoa Thần kinh - Cột sống ', 'Bác sĩ từng công tác tại Khoa Ngoại Thần Kinh – Bệnh viện Chợ Rẫy\nTốt nghiệp Tiến sĩ Y học, Đại học Y Dược TP. Hồ Chí Minh \nBác sĩ nhận khám cho bệnh nhân từ 10 tuổi trở lên', 23, NULL, NULL, '2024-05-28 10:26:14', '2024-05-28 10:26:14');

