INSERT INTO `Specialties` (`id`, `name`, `image`, `descriptionHTML`, `desciptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(3, 'Cơ Xương Khớp', , '<h3><strong>Bác sĩ Cơ Xương Khớp giỏi</strong></h3>\n<p>Danh sách các bác sĩ uy tín đầu ngành Cơ Xương Khớp tại Việt Nam:</p>\n<ul>\n<li>\n<p>Các chuyên gia có quá trình đào tạo bài bản, nhiều kinh nghiệm</p>\n</li>\n<li>\n<p>Các giáo sư, phó giáo sư đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà Nội</p>\n</li>\n<li>\n<p>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu Khoa Cơ Xương Khớp - Bệnh viện Bạch Mai, Bệnh viện Hữu nghị Việt Đức,Bệnh Viện E.</p>\n</li>\n<li>\n<p>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Cơ Xương Khớp, Hội Thấp khớp học,...</p>\n</li>\n<li>\n<p>Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...</p>\n</li>\n</ul>\n<h3><strong>Bệnh Cơ Xương Khớp</strong></h3>\n<p>Gout</p>\n<ul>\n<li>\n<p>Thoái hóa khớp: khớp gối, cột sống thắt lưng, cột sống cổ</p>\n</li>\n<li>\n<p>Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân</p>\n</li>\n<li>\n<p>Tràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vai</p>\n</li>\n<li>\n<p>Loãng xương, đau nhức xương</p>\n</li>\n<li>\n<p>Viêm xương, gai xương</p>\n</li>\n<li>\n<p>Viêm cơ, Teo cơ, chứng đau mỏi cơ</p>\n</li>\n<li>\n<p>Yếu cơ, Loạn dưỡng cơ</p>\n</li>\n<li>\n<p>Các chấn thương về cơ, xương, khớp</p>\n</li>\n<li>\n<p>...</p>\n</li>\n</ul>\n', '### **Bác sĩ Cơ Xương Khớp giỏi**\n\n\nDanh sách các bác sĩ uy tín đầu ngành Cơ Xương Khớp tại Việt Nam:\n\n* Các chuyên gia có quá trình đào tạo bài bản, nhiều kinh nghiệm\n\n* Các giáo sư, phó giáo sư đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà Nội\n\n* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu Khoa Cơ Xương Khớp - Bệnh viện Bạch Mai, Bệnh viện Hữu nghị Việt Đức,Bệnh Viện E.\n* Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Cơ Xương Khớp, Hội Thấp khớp học,...\n\n* Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...\n\n\n### **Bệnh Cơ Xương Khớp**\n\n\nGout\n\n* Thoái hóa khớp: khớp gối, cột sống thắt lưng, cột sống cổ\n\n* Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân\n\n* Tràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vai\n\n* Loãng xương, đau nhức xương\n\n* Viêm xương, gai xương\n\n* Viêm cơ, Teo cơ, chứng đau mỏi cơ\n\n* Yếu cơ, Loạn dưỡng cơ\n\n* Các chấn thương về cơ, xương, khớp\n\n* ...', '2024-06-03 09:49:57', '2024-06-03 09:49:57');
INSERT INTO `Specialties` (`id`, `name`, `image`, `descriptionHTML`, `desciptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(4, 'Thần Kinh', , '<h3><strong>Bác sĩ Thần kinh giỏi</strong></h3>\n<p>Danh sách các giáo sư, bác sĩ chuyên khoa Thần kinh giỏi:</p>\n<ul>\n<li>\n<p>Các giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Thần kinh đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện 108, Bệnh viện Đại học Y Hà Nội, Bệnh viện 103.</p>\n</li>\n<li>\n<p>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Thần kinh Việt Nam, Hội Phẫu thuật Thần kinh...</p>\n</li>\n<li>\n<p>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.</p>\n</li>\n</ul>\n<h3><strong>Khám bệnh chuyên khoa Thần kinh</strong></h3>\n<ul>\n<li>\n<p>Bại Não</p>\n</li>\n<li>\n<p>Đau đầu, chóng mặt, buồn nôn</p>\n</li>\n<li>\n<p>Bệnh Pakison, bệnh tiền đình</p>\n</li>\n<li>\n<p>Bị co cơ, căng dây thần kinh</p>\n</li>\n<li>\n<p>Động kinh, có những cơn vãng ý thức</p>\n</li>\n<li>\n<p>Bị tê bì nửa mặt, chèn dây thần kinh</p>\n</li>\n<li>\n<p>Bồn chồn, lo lắng, hồi hộp, chân tay run</p>\n</li>\n<li>\n<p>Có dấu hiệu tăng động</p>\n</li>\n<li>\n<p>Co rút cổ, đau đầu với mặt, chân tay, vã mồ hôi</p>\n</li>\n<li>\n<p>Chấn thương đầu, dây thần kinh</p>\n</li>\n<li>\n<p>...</p>\n</li>\n</ul>\n', '\n### **Bác sĩ Thần kinh giỏi**\n\n\nDanh sách các giáo sư, bác sĩ chuyên khoa Thần kinh giỏi:\n\n* Các giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Thần kinh đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện 108, Bệnh viện Đại học Y Hà Nội, Bệnh viện 103.\n\n* Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Thần kinh Việt Nam, Hội Phẫu thuật Thần kinh...\n\n* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.\n\n\n### **Khám bệnh chuyên khoa Thần kinh**\n\n\n* Bại Não	   \n\n* Đau đầu, chóng mặt, buồn nôn   \n\n* Bệnh Pakison, bệnh tiền đình	   \n\n* Bị co cơ, căng dây thần kinh\n\n* Động kinh, có những cơn vãng ý thức	   \n\n* Bị tê bì nửa mặt, chèn dây thần kinh\n\n* Bồn chồn, lo lắng, hồi hộp, chân tay run	   \n\n* Có dấu hiệu tăng động	    \n\n* Co rút cổ, đau đầu với mặt, chân tay, vã mồ hôi   \n\n* Chấn thương đầu, dây thần kinh\n\n* ...', '2024-06-03 09:56:13', '2024-06-03 09:56:13');
INSERT INTO `Specialties` (`id`, `name`, `image`, `descriptionHTML`, `desciptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(5, 'Tiêu Hoá', , '<h3><strong>Bác sĩ Chuyên khoa Tiêu hóa</strong></h3>\n<p>Danh sách các bác sĩ Tiêu hóa uy tín đầu ngành tại Việt Nam:</p>\n<ul>\n<li>\n<p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tiêu hóa tại Hà Nội</p>\n</li>\n<li>\n<p>Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội</p>\n</li>\n<li>\n<p>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Nhi Trung ương, Bệnh viện Y học Cổ truyền Việt Nam...</p>\n</li>\n<li>\n<p>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...</p>\n</li>\n</ul>\n<h3><strong>Tư vấn, khám và điều trị các Bệnh Tiêu hóa</strong></h3>\n<ul>\n<li>\n<p>Ăn uống kém, không ngon</p>\n</li>\n<li>\n<p>Rối loạn tiêu hóa, táo bón, trĩ</p>\n</li>\n<li>\n<p>Nhiễm vi khuẩn HP (Helicobacter pylori)</p>\n</li>\n<li>\n<p>Nội soi dạ dày, đại tràng, tiêu hóa</p>\n</li>\n<li>\n<p>Buồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơi</p>\n</li>\n<li>\n<p>Co thắt thực quản, Hội chứng ruột kích thích</p>\n</li>\n<li>\n<p>Đau bụng, dạ dày, đại tràng, thượng vị</p>\n</li>\n<li>\n<p>Viêm đại tràng, dạ dày, tá tràng</p>\n</li>\n<li>\n<p>Ung thư dạ dày, U nang tuyến tụy</p>\n</li>\n<li>\n<p>Bệnh lý về gan, mật</p>\n</li>\n<li>\n<p>...</p>\n</li>\n</ul>\n', '\n### **Bác sĩ Chuyên khoa Tiêu hóa**\n\n\nDanh sách các bác sĩ Tiêu hóa uy tín đầu ngành tại Việt Nam:\n\n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tiêu hóa tại Hà Nội\n\n* Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội\n\n* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Nhi Trung ương, Bệnh viện Y học Cổ truyền Việt Nam...\n\n* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...\n\n\n### **Tư vấn, khám và điều trị các Bệnh Tiêu hóa**\n\n\n* Ăn uống kém, không ngon\n\n* Rối loạn tiêu hóa, táo bón, trĩ\n\n* Nhiễm vi khuẩn HP (Helicobacter pylori)\n\n* Nội soi dạ dày, đại tràng, tiêu hóa\n\n* Buồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơi\n\n* Co thắt thực quản, Hội chứng ruột kích thích\n\n* Đau bụng, dạ dày, đại tràng, thượng vị\n\n* Viêm đại tràng, dạ dày, tá tràng\n\n* Ung thư dạ dày, U nang tuyến tụy\n\n* Bệnh lý về gan, mật\n\n* ...', '2024-06-03 11:49:14', '2024-06-03 11:49:14');
INSERT INTO `Specialties` (`id`, `name`, `image`, `descriptionHTML`, `desciptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(6, 'Tim Mạch', , '<h3><strong>Bác sĩ tim mạch giỏi</strong></h3>\n<p>Danh dách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:</p>\n<ul>\n<li>\n<p>Các chuyên gia được đào tạo bài bản về chuyên ngành Tim mạch tại các trường đại học trong nước và quốc tế.</p>\n</li>\n<li>\n<p>Các giáo sư, phó giáo sư nghiên cứu và giảng dạy tại Đại học Y Hà Nội</p>\n</li>\n<li>\n<p>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Viện Tim Mạch Quốc Gia, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh Viện E, Bệnh Viện Tim Hà Nội</p>\n</li>\n<li>\n<p>Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Tim Mạch Việt Nam</p>\n</li>\n<li>\n<p>Đạt danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...</p>\n</li>\n</ul>\n<h3><strong>Khám tư vấn tim mạch</strong></h3>\n<ul>\n<li>\n<p>Khó thở, Đau ngực, đau tim</p>\n</li>\n<li>\n<p>Tăng huyết áp, hạ huyết áp</p>\n</li>\n<li>\n<p>Rối loạn mỡ máu, cao huyết áp, chóng mặt</p>\n</li>\n<li>\n<p>Bệnh van tim (Hẹp hở van tim), Hẹp động mạch chủ</p>\n</li>\n<li>\n<p>Cảm giác hồi hộp, tim đập nhanh</p>\n</li>\n<li>\n<p>Tim bẩm sinh, có tiền sử bệnh tim to, tiền sử tai biến</p>\n</li>\n<li>\n<p>Đã đặt stent tim, nong động mạch vành</p>\n</li>\n<li>\n<p>Giãn tĩnh mạch chân</p>\n</li>\n<li>\n<p>...</p>\n</li>\n</ul>\n', '\n### **Bác sĩ tim mạch giỏi**\n\n\nDanh dách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:\n\n\n* Các chuyên gia được đào tạo bài bản về chuyên ngành Tim mạch tại các trường đại học trong nước và quốc tế.\n\n* Các giáo sư, phó giáo sư nghiên cứu và giảng dạy tại Đại học Y Hà Nội\n\n* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Viện Tim Mạch Quốc Gia, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh Viện E, Bệnh Viện Tim Hà Nội\n\n* Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Tim Mạch Việt Nam\n\n* Đạt danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...\n\n\n### **Khám tư vấn tim mạch**\n\n\n* Khó thở, Đau ngực, đau tim\n\n* Tăng huyết áp, hạ huyết áp\n\n* Rối loạn mỡ máu, cao huyết áp, chóng mặt\n\n* Bệnh van tim (Hẹp hở van tim), Hẹp động mạch chủ\n\n* Cảm giác hồi hộp, tim đập nhanh\n\n* Tim bẩm sinh, có tiền sử bệnh tim to, tiền sử tai biến	\n   \n* Đã đặt stent tim, nong động mạch vành\n\n* Giãn tĩnh mạch chân\n	   \n* ...', '2024-06-03 11:51:44', '2024-06-03 11:51:44');
INSERT INTO `Specialties` (`id`, `name`, `image`, `descriptionHTML`, `desciptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(7, 'Tai Mũi Họng', , '<h3><strong>Bác sĩ Chuyên khoa Tai Mũi Họng</strong></h3>\n<p>Danh sách các bác sĩ uy tín đầu ngành tại Việt Nam:</p>\n<ul>\n<li>\n<p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tai Mũi Họng tại Hà Nội</p>\n</li>\n<li>\n<p>Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội</p>\n</li>\n<li>\n<p>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Tai Mũi Họng Trung ương, Bệnh viện Quân Y 108...</p>\n</li>\n<li>\n<p>Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ cao cấp,...</p>\n</li>\n</ul>\n<h3><strong>Các bệnh Tai Mũi Họng</strong></h3>\n<ul>\n<li>\n<p>Ù tai, đau tai, chảy máu tai</p>\n</li>\n<li>\n<p>Thủng màng nhĩ, điếc đột ngột</p>\n</li>\n<li>\n<p>Viêm tai giữa</p>\n</li>\n<li>\n<p>Amidan, V.A</p>\n</li>\n<li>\n<p>Viêm xoang</p>\n</li>\n<li>\n<p>Nghẹt mũi</p>\n</li>\n<li>\n<p>Hay bị chảy máu cam</p>\n</li>\n<li>\n<p>Đau cổ họng, khó nuốt</p>\n</li>\n<li>\n<p>Ho kéo dài</p>\n</li>\n<li>\n<p>Ngủ ngáy</p>\n</li>\n<li>\n<p>...</p>\n</li>\n</ul>\n', '\n### **Bác sĩ Chuyên khoa Tai Mũi Họng**\n\n\nDanh sách các bác sĩ uy tín đầu ngành tại Việt Nam:\n\n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tai Mũi Họng tại Hà Nội\n\n* Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội\n\n* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Tai Mũi Họng Trung ương, Bệnh viện Quân Y 108...\n\n* Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ cao cấp,...\n\n\n### **Các bệnh Tai Mũi Họng**\n\n\n* Ù tai, đau tai, chảy máu tai\n\n* Thủng màng nhĩ, điếc đột ngột\n\n* Viêm tai giữa\n\n* Amidan, V.A\n\n* Viêm xoang\n\n* Nghẹt mũi\n\n* Hay bị chảy máu cam\n\n* Đau cổ họng, khó nuốt\n\n* Ho kéo dài\n\n* Ngủ ngáy\n\n* ...', '2024-06-03 11:53:40', '2024-06-03 11:53:40');
INSERT INTO `Specialties` (`id`, `name`, `image`, `descriptionHTML`, `desciptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(8, 'Cột Sống', , '<h3><strong>Bác sĩ Chuyên khoa Cột sống</strong></h3>\n<p>Danh sách các bác sĩ Cột sống uy tín đầu ngành tại Việt Nam.</p>\n<ul>\n<li>\n<p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Thần kinh - Cột sống - Xương khớp tại Hà Nội</p>\n</li>\n<li>\n<p>Các giáo sư, tiến sĩ, bác sĩ là giảng viên Đại học Y khoa Hà Nội, Học viện Quân Y.</p>\n</li>\n<li>\n<p>Các bác sĩ đã, đang công tác tại chuyên Khoa Thần Kinh, Cột sống, Xương Khớp - Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Trung ương Quân đội 108, Bệnh viện 103...</p>\n</li>\n<li>\n<p>Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...</p>\n</li>\n</ul>\n<h3><strong>Bệnh Thần kinh - Cột sống</strong></h3>\n<ul>\n<li>\n<p>Đau cột sống, đau thắt lưng</p>\n</li>\n<li>\n<p>Chấn thương cột sống</p>\n</li>\n<li>\n<p>Cột sống bị đau, sưng, cong, vẹo</p>\n</li>\n<li>\n<p>Đau mỏi cổ vai gáy, bả vai</p>\n</li>\n<li>\n<p>Đau tê mông xuống chân</p>\n</li>\n<li>\n<p>Phồng đĩa đệm</p>\n</li>\n<li>\n<p>Tê bì tay chân</p>\n</li>\n<li>\n<p>Thóa hóa đốt sống</p>\n</li>\n<li>\n<p>Thoái hóa L4, L5</p>\n</li>\n<li>\n<p>Thoát vị đĩa đệm</p>\n</li>\n<li>\n<p>Vôi hóa cột sống</p>\n</li>\n<li>\n<p>Xẹp cột sống</p>\n</li>\n<li>\n<p>...</p>\n</li>\n</ul>\n', '\n### **Bác sĩ Chuyên khoa Cột sống**\n\nDanh sách các bác sĩ Cột sống uy tín đầu ngành tại Việt Nam.\n\n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Thần kinh - Cột sống - Xương khớp tại Hà Nội\n\n* Các giáo sư, tiến sĩ, bác sĩ là giảng viên Đại học Y khoa Hà Nội, Học viện Quân Y.\n\n* Các bác sĩ đã, đang công tác tại chuyên Khoa Thần Kinh, Cột sống, Xương Khớp - Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Trung ương Quân đội 108, Bệnh viện 103...\n\n* Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...\n\n\n### **Bệnh Thần kinh - Cột sống**\n\n\n* Đau cột sống, đau thắt lưng\n\n* Chấn thương cột sống\n\n* Cột sống bị đau, sưng, cong, vẹo\n\n* Đau mỏi cổ vai gáy, bả vai\n\n* Đau tê mông xuống chân\n\n* Phồng đĩa đệm\n\n* Tê bì tay chân\n\n* Thóa hóa đốt sống\n\n* Thoái hóa L4, L5\n\n* Thoát vị đĩa đệm\n\n* Vôi hóa cột sống\n\n* Xẹp cột sống\n\n* ...', '2024-06-03 11:55:30', '2024-06-03 11:55:30');

